values:
&nbsp;ugh, god. I've never been so disgusted with CVS and/or my fellow employees. I am so fucking sick of be the shit of the store. I'm an even bigger shit-oned person than colin is and that is saying something. Today was another oe of those days that had me throwing things, and yell/cussing at things. It was so fucking hot, and I was stuck with the non-working sisters, who made me do practically everything because they apparently couldnt manage to climb a flight of stairs and move some goddamn boxes.&nbsp;so.. because of their lazy asses and colin's being a minor, I had to be the overstock putter-awayer and the backup cashier, all while those fucking lazy dicks stood around talking. in between their saying shit to colin and i about how we need to pick up the pace and "get all this shit put away!" fuck that. I am so fucking shit of this shit. as i said last week after working a horrendous and seemingly eternal five hour shift with marilyn and shelly last week, I am not paid enough to do the work of three people. DO YOUR FUCKING JOBS, ASSHOLES.&nbsp;&nbsp;

Not only was i expected to do both jobs, but one of the bitch twins came up to me while i was ringing up some customers that were in line to tell me that the belt was full and it needed to be emptied. 

Plus it was hot as fuck up there, at least 15 degrees hotter than downstairs, and everyone was bitchinga about ho hot it was down there with their fans and&nbsp;air conditioning while the sweat was dripping off my nose. And I had to be up there for about 3 hours. So... I just started to take breaks, sitting on boxes, laying down to do my daily backercizes, texting angie, etc. fuck you, bitches. then they had the fucking nerve to look at me and say "we appreciate you, Melissa!" I was so pissed i just looked at them and walked away, and have not looked at/talked to them since. 

I am writing my resume tomorrow and&nbsp;going to the internship/co-op/career services office on monday. Get me the fuck out of cvs. I am sick of all the bullshit, everyone bitching about everyone else and talking behind everyone else's backs, the stupid customers, the fucking pervs that hit on me (especially that nasty four-toothed drunk man that started rubbing my shoulders). Ugh. makes me sick just thinking about him. All the rude fucking people who get bitchy and call corporate for not smiling at them or being rude to them while they are yelling at someone on their phones, and being all "wutz muh total!?" without even looking at me. looks at the fucking screen, bitch, i dont want to interrupt such an important conversation detailing what sorts of alohol you drank or who your girl be sleepin wit, or where the fuck you are going to drink some Bud Light, WHOO! Shut the fuck up and get out. 

to top it off, I lost the order for for my 5 year "appretiation gift" as well as the invitation to angela's baby shower. it is either in a tote that will eventually go back to the warehouse, or it is in the garbage. Either way, I have to tell her that i lost it somewhere. She's gonna be mad, and i feel bad.&nbsp;

Ugh.. and the goddamn nightshift talking about how stupid the day people are, right in front of me, and bitching about EVERYTHING. If you dont fucking like it, you dick, do it yourself. and stop the motherfucking whistling or i will cut your lips off. thank you and goodnight.&nbsp;

P.S. Muky (eventhough you don't read this), I am pissed at you.

