&nbsp;Ugh... fuck, today was a bad day.&nbsp;

I woke up with a rather sizeable headache, then I fond that there was no food for breakfast&nbsp; (there was only one egg left [which was for the meatloaf], I did't leave Jessie's house until after 1.30, and didnt feel like driving over to Kroger before I went home to get bananas for this morning), my mom woke me up about a half hour before my alarm went off (while vacuuming, how she used to wake me up all the time last summer, and letting the front storm door slam like she used to wake me up every Sunday (my only day to sleep in) for the past like... three years (since the head of my bed is right on the opposite sside of the wall, I can hear every opening and closing of the door). So then I asked mom why she felt the need to vacuum and hit my door with it at 9.30 in the morning, especially since I vacuumed yesterday. And she was all... "Well, I'm sorry, but it is my day off, and I cant just wait around for you to wake up, I've got alot of shit to do! and the floors eed to be vacuumed everyday!" I do&nbsp;remember when she used to vacuum everyday, and do the dishes at least three times a day, and wet dust at least one time a week, and I can say that the house seemed no cleaner then than it does now. NO, THE FLOORS DO NOT NEED TO BE CLEANED EVERY FUCKING DAY. THEY ARE CLEAN ENOUGH. I MIGHT EVEN EAT PUDDIng OFF OF THEM.... NO I WOULDNT.

Aaaanyway, where was I in my whiney bitching story? oh yeah... so then i was getting ready for&nbsp; school, and i remembered that i still needed to print off my assignment for my first class of the day. so i waited for about... 8.5 minutes for my computer to start, then waited another 4 minutes for the Microsoft Word to start, then i had to wait another 3 minutes ffor Word to convert the file. Alll of this while having to pee so hard but not being able to because mom switchd to cleaning the bathroom. so i finallly got the paper loaded, and i fixed all the stupid little errors and finished those unfinished sentances that I forot about, then printed the fusker. then i went to pee and told momma to skidattl or i would pee on her floor. so i peed, then went and pput that bitchass paper in my backpack (in the wrong folder, btw). anyway, then i went to look for food and there was none, so i made me a peanut butter and lettuce sandwich (minus banana and mayo :( wah!) after this, i ran downstairs to get my clothes out of the dryer and get ready leave, and found out that my pants werent dry in the crotch, eventhough they had been dried twice for like... 2 hours. well, then i was all moist and gross feeling, and my ass kept popping out the top, due to the shirt combination i was wearing. but then i finally left, and drove away, but then i remembered that i forgot my trail mix (BIIITCH!) i said, oh well, i dont need it that bad. then as i was nearing 96, i realized... I dont have my paper! so i got all angry, then drove all the way home and was like.. wait... did i check... and there it was! stuck to another folder! so i swore and put my seatbelt back on and skind my knuckle. so then there was blood running own my finger and i had to wipe it on my shirt. plus i got pissed and ripped the skin flap off and threw it onmy floor so there was nothing to cover the wound. so then i left again... 15 minutes late for class at this point. (but i turned on RENT and rocked the Roger, so I started to feel better). then nothing reall happened until&nbsp;i got to Dearborn, when the front of my car fell into one of the largest, stealthiest potholes i have ever seen. i just love the potholes that seem to be all over all of the roads in the d and dearborn that are bigger than my waist. i mean, seriously. what the fuck? you could fit about 3 yorkies in there. and then i go rolling up to the parking lot and was cruising through the parking lot (because i got there late, there were very few spots open) and went looking for a spot and couldnt find any, so i had to go to the other lot on the other side of the campus, because i was&nbsp;15 minutes late for class at this point. after a 10 minute walk to the CASL, i took the elevator so i wouldnt be any later climbing the 4 flghts of stairs. so i finally got to class and slipped in while the professor's back was turned, but since the only seat open was right next to the whiteboard, he noticed.&nbsp;plus, my feet were wet from a the melting snow and sidewalk-covering oceans. i also discovered that while i was not at&nbsp;class on wednesday, the class made a survey and today we were surveying each other (which was actually fun, as my partner was cool). and then at the end of class, i asked the lady next to me if they turned the apers in and she was like.. yeah, most people did, but he said he will take them on wednesday. was like.... DAMN.&nbsp;

so after that class, which was actually fun(ish), i was in a better mood, so decided to go to kroger to get the cheese, eggs, milk and bananas that we needed (AND A MOON PIE FOR ME!!). i got there and the truck had just go there so there were U-Boats everywehere and there was noplace to move. i went inon the produce/starbucks side and got the bananas and soymilk, but decided that i did not want any part of those pricy eggs, so i&nbsp;went through my coupons and got the one for the regular eggs and set them n the shelf while i picked up my shit. then i went over to the regular egg section.&nbsp;and went to pick a carton up&nbsp;but said...&nbsp;whee are those coupons? I lef the on the shelf!!! so i had to walk to the other side of the store and pick up my coups, while&nbsp;every kroger employee in southeast michigan stood in my way and&nbsp;old people cut in front of me. then i went back and got my coups and tried to find some cheese. then i went to the checkout counter and started to ring my things up and was like.. where the fuck are my eggs!? so.. i didnt get the eggs. but i left and then i was trying to get out of the prking lot (after almost getting run over by some old lady) and was trying to turn left onto 5 mile. which was a no go for like..5 minutes. people kept&nbsp;coming up inthe left lane and blocking me. so then this big ass truck comes up behind me and a kroger&nbsp;semi comes up in the left lane, and starts to&nbsp;make the turn WHICH HE OBVIOUSLY CANNOT MAKE WITHOUT RUNNING ME OVER. SO HE CUTS OFF THE TRAFFIC ON THE ONE SIDE, CREATES A BUILD-UP OF CARS AND COMES ABOUT&nbsp;I------------------------I THAT CLOSE TO MY CAR WITH THE BACK WHEELS. I WAS LIKE... GASP. SO HE&nbsp;OPENS HIS DOOR AND STARTS YELLING TO BACK UP, WHICH ICANNOT DO WITHOUT HITTING THE TRUCK BEHIND ME. AND I CANT GET OUT, EITHER BECAUSE THE CARS ON THE OTHER SIDE WERE GOING AROUND IN THE LEFT TURN LANE&nbsp;AND I WOULD HAVE BEEN SMASHED. SO THEN THE TRUCK BEHIND ME FIINALLY BACKS UP AND I MOVEENOUGH SO THAT I DONE GET RUN OVER, BUT WAS ABOUT 5 INCHES FROM BEING IN THE&nbsp;RIGHT LANE, AND NO ONE WOULD LET ME OUT, THEY JUST SWERVED AND LOOKED AT ME EVILLY. so then i had to go right and through the subdivision.&nbsp;when i finally got home, my mom was like.... oh, i went to the store an got bananas and milk already. i just looked at her. and she said "if you would have called and said you were going to the store, i would have told you!"&nbsp; but i forgot my phone, too.&nbsp;

but then my day started to look up, when i went online and decided to watch last week's Degrassi. then i decided to check out the about a girl site and found out that that, like the best years, has been cancelled. my two favorite shows!!! and they both had the most evil cliff hangers ever!!! i am so pissed at the n right now.... and forever.

so... we had meatloaf for dinner tongith and it was delicious. i guess my day wasnt that bad. i've had worse.&nbsp;

anyway, i still only have about 5 pages done of this midterm for wednesday and i have a but-ton more shit to do, so i will just post this. excuse the grammatical errors, i am not checkking oor proofreading ths. FUCK THAT!!

I am getting so sick of all of this school crap. I want to be done so I can get started on the boss/work crap.&nbsp;

Most professors are just so busy and overworked (or stupid or lazy or just don't give a damn) and they keep changing all of thier crap.&nbsp;

I still have nothing to do but attendance for my Civic Engagement Fellowship, my Qualitative Research Methods professor announced in class today (which I missed due to an overactive colon and sleep cycle) that our next assignments were to be done in groups, and also that my civic engagement midterm was changed the day before from a multiple choice 50 question exam to an essay format group exam.&nbsp;

This is getting so ridiulous that I an sure to drop out if it hadn't been so goddamn expensive.&nbsp;

bleargh. This week is going to&nbsp;blow. Although the test that I was studying for all weekend was announced as postponed until wednesday on that day that I missed last week. So now i have another day to (hopefully) finish the readinds and maybe work on the memorizations of the formulas.&nbsp;

Other than that, this weekedn was good, I saw Muky on Sunday, as it is our weekly see-each-other day. we made chicken pot pie and this delicious lemon chaffon pie thing. then at midnight he told me "oh yeah, i might need to be getting out of here early tonight. i'm helping my dad work at 4." and was like... do you have school? wait.. i thought you worked tomorrow!" to which he replied tat he was working at 4 in the morning..... 3 hours from the time he left. so i threw him out.

i am now sitting here eating lunch before work, a delightful banana, peanut butter, mayonnaise and lettuce sangwich. and some cinnamon tea.&nbsp;

God, I am fucking pissed right now.&nbsp; 

I am ready to just send this mother fucking thing back and be done with it.&nbsp; 

I am really irritated that after&nbsp;almost 4&nbsp;hours of being on the phone with 3 different Customer Service people from two different companies that I still have no idea how to connect to the fucking internet, or why AT&amp;T is saying that our encryption key is wrong, or&nbsp;all this other shit. Everyone is saying&nbsp;different things&nbsp;and shifting the blame on someone else.&nbsp;Who the fuck can help me if you fuckers cant? 

Unless I just have to send this new computer that I've had for&nbsp;5 days back&nbsp;Dell for repairs.&nbsp; And if that is the case, they can just keep the damn thing.&nbsp;&nbsp;

And the Dell man saying "hhrmmm.. this is really strange... I don't understand why this is doing this...."&nbsp; and then following up with a "this is the second call like this I've had on this system recently" doesn't help. 

Ugh, my head hurts.&nbsp;&nbsp;

In other news, I got the information about my fellowship with the Civic Engagement Project at school, including my end of the semester $500 stipend. I dont care what I have to do... bring on the monies!! I det to take attendence!

soooo.... i bought a laptop on Monday.&nbsp;

It wont be shipped until next month, but I got the external hard drive today.... and it is pretty...

and i can feel it whirring under my hand.&nbsp;

It looks simple enough to use. let's see if i can figure it out!

Well, that was uneventful.&nbsp; Jennifur and I just drove to the D and back, since the DIA line was out around the front of the building and we said "Fuck that!" and came back here to watch Shrek the Third.&nbsp; But... we decided to go next weekend and just pay the $7.&nbsp;

Anyway... that was fun.&nbsp; tonight I wish to play some liquor pong and maybe some Guitar Hero and fall asleep on the floor.&nbsp; Than get up and go to work at 9, then come home and finally try to finish this fucking stupid ass paper.&nbsp;

then I will pass out and/or eat things.... or go see Beowulf.&nbsp;

